import React from "react";

const Navbar = () => {
  return (
    <nav className="bg-gray-900 p-4 shadow-md">
      <h1 className="text-white text-2xl font-semibold text-center">
        AI Fitness & Diet Coach
      </h1>
    </nav>
  );
};

export default Navbar;
